import React from "react";
import { useParams, Route } from "react-router-dom";

const QuoteDetails = () => {
  const params = useParams();

  return (
    <React.Fragment>
      <h1>Quote Details Page</h1>
      <p>{params.quoteId}</p>
      <Route path={`/quotes/${params.quoteId}/comments`}></Route>
    </React.Fragment>
  );
};

export default QuoteDetails;
